The Fray is a Grammy Award-nominated four-piece piano rock band. Formed in 2002 by schoolmates Isaac Slade and Joe King, the Denver-based group released their debut album How to Save a Life in 2005. The band is best known for the song &quot;How to Save a Life&quot;, which charted in the top three of the Billboard Hot 100 and was also a top 5 single in Canada, Australia, Ireland, Sweden, and the United Kingdom. The Fray also found national success with the songs &quot;Over My Head (Cable Car)&quot; and &quot;You Found Me&quot;, which became a top fifteen hits in the United States and Canada. How to Save a Life was certified double platinum by the RIAA and was also certified platinum in Australia and New Zealand. The Fray recently signed on for the 2008/2009 year as an ambassador for VH1's Save The Music Foundation. They performed at the American Music Awards on November 23, 2008.
